build_sqlite()
{
    start_dir=$PWD
    cd sqlite-version-3.38.2
    ./configure --prefix=$1
    make -j 99 && make install
    cd $start_dir
}

build_proj()
{
    start_dir=$PWD
    cd proj-8.2.0
    ./configure --prefix=$1 --without-curl --without-mutex
    make -j 99 && make install
    cd $start_dir
}

build_hdf5() {
    start_dir=$PWD
    cd hdf5-hdf5-1_12_1
    ./configure --prefix=$1
    make -j 99 && make install
    cd $start_dir
}

build_netcdf() {
    start_dir=$PWD
    cd netcdf-c-4.8.1
    ./configure --prefix=$1 --enable-shared --enable-netcdf-4 --with-pic
    make -j 99 && make install
    cd $start_dir
}

build_cdo() {
    start_dir=$PWD
    cd cdo-2.0.5
    ./configure --with-netcdf=$1 --with-hdf5=$1 --with-proj=$1 --prefix=$1
    make -j 99 && make install
    cd $start_dir
}

