  #download CESM1 Data
  mkdir -p data/CESM1
  start_dir=$PWD
  cd data/CESM1
  echo "Running $(basename $0) version: $version"

  #do we have old results? Create the file if not
  [ ! -f $CACHE_FILE ] && echo "#filename mtime checksum" > $CACHE_FILE

  download_cesm1

  #remove duplicates (if any)
  { rm $CACHE_FILE && tac | awk '!x[$1]++' | tac > $CACHE_FILE; } < $CACHE_FILE

  #move CESM data to follow required data subfolders
  for var_name in ICEFRAC SST HI TS
  do
      for fname in `ls *$varname*.nc`
      do
	  x=$fname | awk -F/ '{print $NF}'
	  mv $x data/CESM1/monthly/LargeEnsemble/$var_name/
      done
  done
  
  cd $start_dir
  mkdir -p data/NSIDC
  start_dir=$PWD
  cd data/NSIDC
  # download nsidc data
  download_nsidc
  
